commit.message:
Add: add nasl ssh function to select a netconf ssh subsystem (#1594)

`openvas-nasl -X -B -i /home/jnicola/install/var/lib/openvas/plugins -t 192.168.1.100 ssh_netconf.nasl`

```
include("ssh_func.inc");
include("misc_func.inc");

port = 830; #Netconf default port
user = 'uesername';
pass = 'password';

soc = open_sock_tcp( port );
if( ! soc ) exit( 0 );
display (soc);

display("Open connection");
sess = ssh_connect( socket:soc );
display("User Auth");
prompt = ssh_userauth(sess, login:user, password:pass);

display("Set Netconf subsystem and get the shell");
sess = ssh_execute_netconf_subsystem (sess);

sleep(1);
rhello = ssh_shell_read (sess);
display("hello response: \n\n", rhello);

hello = "<?xml version='1.0' encoding='UTF-8'?>\n<hello><capabilities><capability>urn:ietf:params:xml:ns:netconf:base:1.0</capability></capabilities></hello>\n]]>]]>\n\n";
ssh_shell_write(sess, cmd: hello);

cmd = '<rpc><get-software-information/></rpc>]]>]]>';
ssh_shell_write(sess, cmd: cmd);

sleep(1);
rcmd = ssh_shell_read (sess);
display("cmd response: \n\n", rcmd);

ssh_shell_close(sess);
ssh_disconnect(sess);
display("Finished, close, disconnet");
```

